import React from "react";
import { css, jsx } from "@emotion/core";
import styled from "@emotion/core";

import Header from "./header.js";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div
        css={css`
          height: 100px;
          width: auto;
        `}
      >
        <Header />
        {/* <Form /> */}
      </div>
    </div>
  );
}

export default App;
